INSERT IGNORE INTO `community_post` (`post_uid`, `delete_reason`, `is_deleted`, `post_category`, `post_content`, `post_created_at`, `post_id`, `post_img_url`, `post_title`, `post_updated_at`, `post_view_count`, `user_id`) VALUES
	('012348c2-b5af-4612-ae40-7a85051e4206', 'NULL', b'0', 'BUYANDSELL', '고급 강아지 배변패드를 판매합니다. 한 박스에 100매 들어있으며, 흡수력이 뛰어나고 냄새 차단 기능이 탁월합니다. 상태 매우 좋고, 사용기한은 2025년 5월까지입니다. 가격은 20,000원입니다. 필요하신 분은 연락 주세요.', '2024-12-03 20:15:00.000000', 25, '["http://localhost:8080/upload/a90975fb-79d5-4487-9289-60c12b727023.jpg"]', '고급 강아지 배변패드 판매합니다', '2024-12-03 20:15:00.000000', 150, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('04bdd6bd-91a8-4e30-a675-c8183345066c', 'NULL', b'0', 'BUYANDSELL', '고양이 장난감 세트 판매합니다. 고양이가 좋아할 만한 터널, 공, 레이저 포인터 등이 포함되어 있습니다. 새 제품으로 한 번도 사용하지 않았습니다.', '2024-12-04 04:00:00.000000', 40, '["http://localhost:8080/upload/91cdbada-0dde-466e-94f7-a9b5ad334bee.jpg"]', '고양이 장난감 세트 팝니다! 터널, 공, 레이저 포인터', '2024-12-04 04:00:00.000000', 150, '8fb98fb6-6b3c-4a00-92f8-68a0f53bf0ae'),
	('07f6ef86-e9a4-4d85-a6fd-2629f4155dbd', 'NULL', b'0', 'REPORT', '동물 시장에서 불법 밀매가 의심되는 상황을 목격했습니다. 여러 종류의 동물들이 합법적인 절차 없이 판매되고 있으며, 이에 대해 신고하고자 합니다.', '2024-12-04 13:30:00.000000', 52, '["http://localhost:8080/upload/e69158cc-0a3a-41c5-a966-fdc0f34c83ea.jpg"]', '불법 동물 밀매 의심 신고', '2024-12-04 13:30:00.000000', 300, '99571590-bf45-4ad0-ac32-de1c7cb1b1ff'),
	('080d15fe-cf39-424e-a67d-e17bc1de534d', 'NULL', b'0', 'REPORT', '온라인에서 불법 애완동물 판매자가 있음을 확인했습니다. 특정 사이트에서 불법적으로 애완동물을 판매하고 있으며, 이는 동물 보호법을 위반한 행위입니다. 신고합니다.', '2024-12-04 08:00:00.000000', 44, '["http://localhost:8080/upload/ff723a2c-a9b4-4baa-b272-bc18a231af74.jpg"]', '불법 애완동물 판매 신고합니다', '2024-12-04 08:00:00.000000', 180, '54a8cbc2-b17e-419a-b22f-8cf7bb795c29'),
	('0936f880-ef1f-4966-9468-87174b5ecb40', 'NULL', b'0', 'FINDCHILD', '2024년 12월 2일 대전 중구에서 검은색 고양이가 실종되었습니다. 성격이 매우 온순하며, 목에 하얀색 목걸이를 착용하고 있습니다. 찾으신 분은 연락 부탁드립니다.', '2024-12-03 20:00:00.000000', 24, '["http://localhost:8080/upload/d63c38c7-a3e2-4b21-bc7c-f0a091db64fe.jpg"]', '대전 중구에서 실종된 고양이 찾습니다', '2024-12-03 20:00:00.000000', 280, '9790d693-9538-4950-b6d9-e01befcbadac'),
	('09b0f7ab-6e9f-48e5-bb18-206f05e9c073', 'NULL', b'0', 'ANNOUNCEMENT', '새로운 가족을 기다리는 유기견들을 소개합니다. 다양한 품종의 유기견들이 입양을 기다리고 있습니다. 관심이 있는 분들은 보호소를 방문하여 상담을 받으세요.', '2024-12-04 19:00:00.000000', 70, '[]', '유기견 보호소 신규 입양견 소개', '2024-12-04 19:00:00.000000', 180, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('0ab97bf5-b85b-4ed5-bddc-43565eb790a9', 'NULL', b'0', 'ADOPTREVIEW', '입양한 지 하루가 지났습니다! 처음에는 조금 낯설어했지만, 이제는 우리 집에서 편안하게 지내고 있어요. 너무 사랑스러운 강아지입니다. 함께한 시간들이 너무 행복해요.', '2024-12-01 10:00:00.000000', 2, '["http://localhost:8080/upload/72c1e44d-a14e-4ddf-bd8c-4ac217687981.jpg"]', '우리 강아지 입양 후 첫날 이야기', '2024-12-01 10:00:00.000000', 512, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('0b453864-7834-42ed-bb42-d82f9d7240f2', 'NULL', b'0', 'BUYANDSELL', '고급 스테인리스 강아지 사료 그릇 세트를 판매합니다. 2개 세트로, 내구성이 뛰어나며, 청소가 간편합니다. 크기는 중형 강아지에게 적합하고, 상태는 매우 좋습니다. 가격은 15,000원입니다.', '2024-12-03 22:00:00.000000', 30, '["http://localhost:8080/upload/fc886cf5-6478-42f3-9162-913862eb9626.jpg"]', '고급 스테인리스 강아지 사료 그릇 세트 판매', '2024-12-03 22:00:00.000000', 150, '8e968eff-bb85-4cf0-a2c1-cb11bd0733fd'),
	('0bea6e68-30ea-4b6a-bd07-155e05a90f95', 'NULL', b'0', 'ADOPTREVIEW', '\'구름\'을 입양한 지 며칠 됐는데 정말 사랑스러운 아이예요! 처음에는 조금 낯설어했지만, 이제는 집안 곳곳을 돌아다니며 나랑 함께 놀자고 해요. 가족이 되어줘서 고마워요!', '2024-12-04 05:00:00.000000', 41, '["http://localhost:8080/upload/b9f2d269-4c62-421e-a2e7-6d9132a13b11.jpg"]', '입양한 강아지 \'구름\'의 첫날', '2024-12-04 05:00:00.000000', 300, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('0f3125ea-80cb-4a5b-8af2-61cf122f7b31', 'NULL', b'0', 'BUYANDSELL', '강아지 사료 10kg 판매합니다. 유기농 원료로 만들어진 고품질 사료로, 저희 강아지가 먹지 않아서 판매합니다. 유통기한은 2025년 6월까지입니다. 가격은 25,000원입니다.', '2024-12-04 18:30:00.000000', 60, '["http://localhost:8080/upload/c38418ec-954d-479b-b1ba-220b9d834ac1.jpg"]', '강아지 사료 10kg 판매합니다.', '2024-12-04 18:30:00.000000', 220, '7da7183d-1726-458a-a620-93590251ca85'),
	('0f60e2fa-8b8d-494a-a7dc-1aa1be073678', 'NULL', b'0', 'BUYANDSELL', '고급 고양이 캣타워를 판매합니다. 여러 층으로 구성되어 있으며, 고양이가 편안하게 쉴 수 있는 공간이 많습니다. 상태 매우 양호하고, 사용감이 거의 없습니다. 가격은 45,000원입니다.', '2024-12-03 19:15:00.000000', 22, '["http://localhost:8080/upload/ef797349-d03f-41ad-ade3-b4e2288de882.jpg"]', '고급 고양이 캣타워 판매합니다', '2024-12-03 19:15:00.000000', 210, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('196f2fce-4daa-4973-8005-8772ff4bf854', 'NULL', b'0', 'FINDCHILD', '대전에서 흰색 고양이 \'눈송이\'가 실종되었습니다. 이름처럼 하얀 털을 가진 고양이로, 목걸이는 없으며, 다소 소심한 성격입니다. 보신 분은 꼭 연락 주세요.', '2024-12-04 01:00:00.000000', 35, '["http://localhost:8080/upload/d3927e25-7960-47f7-9284-ed0b034e7d2f.jpg"]', '대전에서 실종된 고양이 \'눈송이\' 찾습니다', '2024-12-04 01:00:00.000000', 145, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('1b7f8310-1f2d-443c-991f-06401c3cf975', 'NULL', b'0', 'FINDCHILD', '부산 해운대구에서 2024년 12월 2일 고양이가 실종되었습니다. 흰색 고양이이며, 눈 주위에 얼룩이 있습니다. 목격하신 분은 연락 주세요.', '2024-12-03 12:15:00.000000', 9, '["http://localhost:8080/upload/3546166d-4967-4a86-80df-77a98ac63975.jpg"]', '부산 해운대구에서 실종된 고양이 찾습니다', '2024-12-03 12:15:00.000000', 309, 'cdfc0ea0-cc93-4468-a50b-c89bd2071ef6'),
	('1cb04950-5d72-44e5-9528-22f4076b9cca', 'NULL', b'0', 'REPORT', '오늘 아침, 공원에서 유기된 고양이를 발견했습니다. 고양이는 매우 약해 보였고, 즉시 동물 보호소에 연락했습니다. 유기동물 문제에 대한 빠른 대처가 필요합니다.', '2024-12-04 09:30:00.000000', 47, '["http://localhost:8080/upload/631322bd-1207-4e00-9608-9e89681c65c3.jpg"]', '고양이 유기 신고', '2024-12-04 09:30:00.000000', 210, '7a92ae42-876c-4297-9b5c-95c6e7de2eda'),
	('1d1a76bb-8da1-45b3-8d87-23650e21f4c3', 'NULL', b'0', 'FINDCHILD', '2024년 12월 2일, 서울 서초구에서 흰색과 회색 털을 가진 고양이가 실종되었습니다. 성격이 온순하고, 목걸이를 착용하고 있습니다. 찾으신 분은 연락 주세요.', '2024-12-03 18:20:00.000000', 19, '["http://localhost:8080/upload/673b4150-c7bd-4b9e-8965-a72d6d508e05.jpg"]', '서울 서초구에서 실종된 고양이 찾습니다', '2024-12-03 18:20:00.000000', 350, 'f78f04bf-eccd-4f7a-8389-6b241a7a6aae'),
	('1e9267e4-c63b-4822-9e33-4c903e32f33b', 'NULL', b'0', 'FINDCHILD', '2024년 12월 1일 경기도 고양시에서 작은 흰색 강아지가 실종되었습니다. 눈 주위에 검은 얼룩이 있으며, 매우 친근한 성격입니다. 목격하신 분은 연락 부탁드립니다.', '2024-12-03 15:30:00.000000', 11, '["http://localhost:8080/upload/f4870e9a-c0b8-47b6-bf6a-3acaeb2ffaf0.jpg"]', '경기도 고양시에서 실종된 강아지 찾습니다', '2024-12-03 15:30:00.000000', 450, '348d99fe-8c08-436a-8597-31c64598a2f0'),
	('1f6e13cd-bf9f-41ff-b774-9988a7f73868', 'NULL', b'0', 'ANNOUNCEMENT', '유기견 보호소에서는 새벽 산책 봉사자를 모집합니다. 유기견들에게 아침 산책을 제공해 줄 자원봉사자분들의 참여를 부탁드립니다. 자세한 내용은 공지사항을 참고해 주세요.', '2024-12-04 23:00:00.000000', 74, '[]', '유기견 보호소 새벽 산책 봉사자 모집', '2024-12-04 23:00:00.000000', 150, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('2039cfe3-aeb4-4d11-8e46-68061150667c', 'NULL', b'0', 'ADOPTREVIEW', '\'토리\'를 입양한 후 첫날부터 반가워하며 다가와줬어요. 아주 기분 좋은 시작이었고, 이제는 집 안을 뛰어다니며 에너지를 발산하고 있어요! 정말 사랑스러운 아이입니다.', '2024-12-04 06:00:00.000000', 43, '["http://localhost:8080/upload/915fc987-e21a-439a-b96c-e78222db27c2.jpg"]', '우리 집에 온 \'토리\', 첫 인사', '2024-12-04 06:00:00.000000', 180, '99571590-bf45-4ad0-ac32-de1c7cb1b1ff'),
	('2847db03-d380-4f73-a876-97561bc77312', 'NULL', b'0', 'FINDCHILD', '2024년 11월 30일 대구 수성구에서 고양이가 실종되었습니다. 회색 털을 가진 고양이로, 발끝에 작은 흰색 반점이 있습니다. 목격하신 분은 연락 부탁드립니다.', '2024-12-03 17:00:00.000000', 15, '["http://localhost:8080/upload/16065b40-28fd-4d87-a9e5-fec9902c1a31.jpg"]', '대구 수성구에서 실종된 고양이 찾습니다', '2024-12-03 17:00:00.000000', 560, '9790d693-9538-4950-b6d9-e01befcbadac'),
	('289ef17d-9619-417e-ae86-0fbd06ed0d18', 'NULL', b'0', 'FINDCHILD', '서울 강남구 역삼동에서 2024년 11월 25일, 고양이가 실종되었습니다. 고양이는 흰색과 회색이 섞인 털을 가지고 있으며, 귀가 조금 찢어져 있습니다. 목격하신 분은 연락 부탁드립니다. 연락처: 010-1234-5678', '2024-11-25 14:32:00.000000', 1, '["http://localhost:8080/upload/37b47012-3c8e-4cb8-b188-9408a9d5fc29.jpg"]', '서울 강남구에서 실종된 고양이 찾습니다!', '2024-11-25 14:32:00.000000', 234, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('2d3c78ab-f8de-4842-804a-f6edca5efed1', 'NULL', b'0', 'ANNOUNCEMENT', '우리 보호소의 유기견들이 치료를 받고 있습니다. 치료비 후원을 위한 캠페인이 시작되었습니다. 작은 금액이라도 많은 도움이 됩니다. 후원에 참여해 주세요.', '2024-12-04 13:00:00.000000', 64, '[]', '유기견 병원비 후원 캠페인 안내', '2024-12-04 13:00:00.000000', 120, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('3a849c74-8904-4537-a3a8-e3b73961399a', 'NULL', b'0', 'BUYANDSELL', '강아지용 운동기구를 판매합니다. 상태는 아주 좋고, 거의 사용하지 않았습니다. 크기는 중형견용이며, 가격은 20만원입니다. 서울 지역에서 직거래 가능합니다. 관심 있는 분은 연락 주세요.', '2024-11-28 18:20:00.000000', 3, '["http://localhost:8080/upload/bf8f69ad-5a05-4726-a2ae-31db98a2e936.jpg"]', '강아지 운동기구 판매합니다', '2024-11-28 18:20:00.000000', 650, '99571590-bf45-4ad0-ac32-de1c7cb1b1ff'),
	('3b64907d-36da-450b-ad6c-02f948b17cc5', 'NULL', b'0', 'BUYANDSELL', '고급 강아지 침대를 판매합니다. 중형견용으로, 푹신한 메모리폼이 장착되어 있어 강아지가 편안하게 쉴 수 있습니다. 상태는 매우 양호하며, 사용감이 거의 없습니다. 가격은 50,000원에 판매합니다.', '2024-12-03 17:30:00.000000', 20, '["http://localhost:8080/upload/e07b0090-310f-4764-b449-b506b5a346b1.jpg"]', '고급 강아지 침대 판매합니다 (중형견용)', '2024-12-03 17:30:00.000000', 250, '471432b6-ff68-4f1d-a987-45b0c99ee32e'),
	('45934b4e-1b7e-4f6d-ad85-0566d552a97c', 'NULL', b'0', 'REPORT', '오늘 아침 서울 강남구 논현동 공원 주변에서 어린 강아지 3마리가 버려진 채 발견되었습니다. 추정 나이는 2-3개월로 보이며, 영양실조와 상처의 흔적이 있어 즉각적인 구조가 필요해 보입니다. 근처 동물보호센터나 관계자분들의 신속한 대응을 요청드립니다.', '2024-12-02 16:45:00.000000', 4, '["http://localhost:8080/upload/54cb159c-40c7-41da-9742-b635062fa244.jpg"]', '버려진 강아지 3마리 발견, 긴급 도움 필요', '2024-12-02 16:45:00.000000', 324, '7a92ae42-876c-4297-9b5c-95c6e7de2eda'),
	('4a4713ff-84f6-46d9-9055-94a1ba61e69e', 'NULL', b'0', 'REPORT', '충청북도 청주시 외곽의 한 농장에서 극심한 동물 학대 정황을 목격하고 신고합니다. 다수의 가축들이 극도로 열악한 환경에서 사육되고 있으며, 심각한 영양실조와 질병 증상을 보이고 있습니다. 농림축산식품부와 동물보호단체의 즉각적인 조사를 강력히 요청드립니다.', '2024-12-03 21:30:00.000000', 29, '["http://localhost:8080/upload/acd56577-a0cc-42ac-b48e-463d4f6a6deb.jpg"]', '농장에서 발견된 심각한 동물 학대 정황', '2024-12-03 21:30:00.000000', 70, '1a8c7c68-0fe6-4f80-a1f7-db71a9470731'),
	('4c4f0ed3-34f2-4d1a-8f6e-b2b0f9bb5ff5', 'NULL', b'0', 'ANNOUNCEMENT', '유기견 보호소에서는 외부 봉사활동도 진행합니다. 보호소와 협력하여 유기견을 위한 봉사활동에 참여하실 분들의 많은 관심 부탁드립니다. 자세한 사항은 공지사항을 확인해 주세요.', '2024-12-04 15:00:00.000000', 66, '[]', '유기견 보호소 외부 봉사활동 안내', '2024-12-04 15:00:00.000000', 130, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('4c5a1728-20e3-46e8-acf3-fff3d1f69425', 'NULL', b'0', 'BUYANDSELL', '강아지 목줄과 리드줄 세트를 판매합니다. 고급 소재로 제작된 제품으로, 크기는 중형견용입니다. 상태는 매우 양호하며, 2023년 12월에 구입한 제품입니다. 가격은 15,000원이며, 직거래 가능합니다.', '2024-12-03 11:20:00.000000', 6, '["http://localhost:8080/upload/4b632f86-1b12-4834-8ff4-75c63fccb972.jpg"]', '강아지 목줄과 리드줄 세트 판매합니다', '2024-12-03 11:20:00.000000', 412, '08ff8005-3bae-453c-b2f9-d6fa24b57901'),
	('4e134e49-2ac2-4067-8249-30bbe3187845', 'NULL', b'0', 'FINDCHILD', '\'미미\'는 지난 12월 2일 오후 3시경 우리 집 근처에서 실종되었습니다. 흰색과 회색이 섞인 털을 가지고 있으며, 귀가 약간 접혀 있습니다. 혹시 발견하신 분은 연락 바랍니다.', '2024-12-04 10:30:00.000000', 48, '["http://localhost:8080/upload/fca8c73f-2470-4d02-9d59-c99010e0fbb5.jpg"]', '실종된 고양이 \'미미\'를 찾습니다', '2024-12-04 10:30:00.000000', 220, '08ff8005-3bae-453c-b2f9-d6fa24b57901'),
	('4f641944-3455-44c6-83eb-13c306073796', 'NULL', b'0', 'ADOPTREVIEW', '지난 주 입양한 강아지가 이제 집에 완전히 적응했어요. 너무 사랑스러워서 매일매일 행복합니다. 입양을 망설이지 말고, 사랑을 주면 그만큼 돌아옵니다.', '2024-12-02 19:30:00.000000', 17, '["http://localhost:8080/upload/ea368de6-56d2-4edc-a71d-3b79483302a4.jpg"]', '입양 후 첫날, 정말 행복해요', '2024-12-02 19:30:00.000000', 432, '7a92ae42-876c-4297-9b5c-95c6e7de2eda'),
	('56f8c025-a973-4f82-9cd8-27b4677fc5ac', 'NULL', b'0', 'ADOPTREVIEW', '\'코코\'는 입양한 지 1개월 된 고양이입니다. 처음에는 조금 낯설어했지만 이제는 나와 함께 자고, 놀고, 먹고 있어요. \'코코\'는 매우 활동적이고, 장난감을 좋아하는 고양이입니다. 입양 후 정말 많은 행복을 느끼고 있어요.', '2024-12-04 17:00:00.000000', 58, '["http://localhost:8080/upload/f505c3f1-557d-45d8-8d5c-87ae039abd3c.jpg"]', '입양 후 고양이 \'코코\'와의 일상', '2024-12-04 17:00:00.000000', 200, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('5b264b7b-3b16-4ab2-a7fd-3f8a7a9cf943', 'NULL', b'0', 'ANNOUNCEMENT', '겨울철 유기견 보호소의 안전 관리가 강화됩니다. 추운 날씨로 인한 피해를 최소화하기 위해 보호소 내부 온도 관리 및 유기견들의 건강 상태를 체크할 예정입니다.', '2024-12-04 20:00:00.000000', 71, '[]', '유기견 보호소 겨울철 안전 관리 안내', '2024-12-04 20:00:00.000000', 90, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('5cdb9919-89d0-4024-88b5-d9e7d6ad31b6', 'NULL', b'0', 'ANNOUNCEMENT', '입양 후 유기견을 어떻게 잘 돌볼 수 있을지에 대한 팁을 안내드립니다. 유기견들이 새로운 가정에서 잘 적응할 수 있도록 돕기 위한 정보들이 담겨 있습니다. 입양 전 필독해주세요.', '2024-12-04 21:00:00.000000', 72, '[]', '유기견 보호소 입양 후 관리 팁 안내', '2024-12-04 21:00:00.000000', 110, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('5d1d30a7-5406-4b89-bad2-4f39de705524', 'NULL', b'0', 'FINDCHILD', '부산 해운대구에서 검은색 푸들이 실종되었습니다. 이름은 \'바니\'이며, 주황색 목줄을 착용하고 있습니다. 목격되신 분은 연락 부탁드립니다.', '2024-12-03 20:30:00.000000', 26, '["http://localhost:8080/upload/1b125e5a-142d-443a-8e8d-847740c0d456.jpg"]', '부산 해운대구에서 실종된 강아지 찾습니다', '2024-12-03 20:30:00.000000', 180, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('6f1ab178-cb94-4ca3-96c1-967e22eaa350', 'NULL', b'0', 'ANNOUNCEMENT', '우리 보호소의 후원자 여러분을 위한 감사 행사가 12월 10일 진행됩니다. 행사에 참여하셔서 유기견들을 돕는 의미 있는 시간을 보내세요. 자세한 사항은 공지사항을 통해 확인해 주세요.', '2024-12-04 12:00:00.000000', 63, '[]', '유기견 보호소 후원자 감사 행사 안내', '2024-12-04 12:00:00.000000', 150, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('6f88a869-b28b-41ce-8d72-6f3bebc5a6f7', 'NULL', b'0', 'REPORT', '광주 광역시 한 대학 캠퍼스 주변에서 최소 10마리 이상의 유기묘가 발견되었습니다. 대부분 어린 고양이들로 영양실조와 질병 의심 증상이 있어 시급한 구조와 치료가 필요해 보입니다. 지역 동물보호센터의 신속한 대응을 호소합니다.', '2024-12-03 19:30:00.000000', 23, '["http://localhost:8080/upload/53b49bdb-0178-4e3d-91e9-eed100171ea7.jpg"]', '대학가 주변 유기묘 대량 발견, 긴급 구조 요청', '2024-12-03 19:30:00.000000', 98, 'f56bff85-d3e5-4c05-9b73-d9441950467a'),
	('7200f7f2-18c2-4071-931f-be7bda31ce05', 'NULL', b'0', 'ADOPTREVIEW', '입양한 고양이 \'미르\'가 집에 오고 나서 적응하기까지 시간이 걸렸지만, 이제는 정말 친근하게 다가와요. 아주 사랑스러운 녀석이에요!', '2024-12-04 00:30:00.000000', 34, '["http://localhost:8080/upload/b20dcb23-06f9-42cc-bbb4-135038b78725.jpg"]', '입양한 고양이 \'미르\'의 첫날', '2024-12-04 00:30:00.000000', 310, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('725718b1-d7e6-4f49-9402-4aff71d13584', 'NULL', b'0', 'BUYANDSELL', '고양이 자동 급식기를 판매합니다. 2식사 설정 가능하며, 스마트폰으로 원격 조정이 가능합니다. 상태 매우 좋고, 2023년 11월에 구입한 제품입니다. 가격은 30,000원이며, 직거래 가능합니다.', '2024-12-03 14:00:00.000000', 10, '["http://localhost:8080/upload/8a186e8c-e4e2-4ffa-ac9d-df3c0f835160.jpg"]', '고양이 자동 급식기 판매합니다', '2024-12-03 14:00:00.000000', 151, 'f78f04bf-eccd-4f7a-8389-6b241a7a6aae'),
	('7993d9dd-2718-4ef4-bfec-2bee84885381', 'NULL', b'0', 'ADOPTREVIEW', '입양한 고양이가 이제 집에 적응해서 잘 지내고 있어요. 처음엔 낯설어했지만, 이제는 사람들과 함께 자고, 잘 먹고 잘 놀아요. 너무 행복합니다.', '2024-11-30 09:45:00.000000', 7, '["http://localhost:8080/upload/852adeb1-3d3e-4b8a-a9b7-8c4ae64ec3ea.jpg"]', '입양한 고양이가 잘 지내고 있어요!', '2024-11-30 09:45:00.000000', 687, '368de3a0-e332-4cbd-ac9f-eb8f39c7a97e'),
	('79a1dbad-774a-4c12-af2f-dfa514da37cc', 'NULL', b'0', 'BUYANDSELL', '사이즈 L인 강아지 옷을 판매합니다. 한 번도 입히지 않았고, 상태는 매우 새 것입니다. 강아지에게 딱 맞는 예쁜 디자인으로, 겨울에 따뜻하게 입힐 수 있습니다. 가격은 15,000원입니다. 관심 있으신 분은 연락 주세요!', '2024-12-04 17:30:00.000000', 59, '["http://localhost:8080/upload/e9bc7252-1380-414d-ad89-5e301ce8336e.jpg"]', '사이즈 L 강아지 옷 판매합니다.', '2024-12-04 17:30:00.000000', 150, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('83974a1c-7581-4cef-9481-0d5f02fa8a8f', 'NULL', b'0', 'ADOPTREVIEW', '입양한 고양이가 집에 와서 첫날부터 너무 귀엽고 친절하게 다가왔어요. 이제는 가족처럼 함께 살고 있답니다. 입양을 망설이지 마세요!', '2024-12-03 21:00:00.000000', 27, '["http://localhost:8080/upload/b0208404-1b1d-4462-962c-ab529ebe177b.jpg"]', '입양한 고양이가 너무 사랑스러워요!', '2024-12-03 21:00:00.000000', 320, '8fb98fb6-6b3c-4a00-92f8-68a0f53bf0ae'),
	('8a3a14b2-ab57-4974-9175-1144d1e67e41', 'NULL', b'0', 'ADOPTREVIEW', '입양한 고양이 \'소나무\'는 처음에는 너무 소심했지만, 이제는 우리 집에서 가장 활발하고 애교 많은 고양이가 되었어요! 너무 사랑스럽습니다.', '2024-12-03 22:45:00.000000', 32, '["http://localhost:8080/upload/9bd3bb15-4875-41e3-aab3-eaa8a7bf8624.jpg"]', '입양한 고양이 \'소나무\'의 변화', '2024-12-03 22:45:00.000000', 190, '8e968eff-bb85-4cf0-a2c1-cb11bd0733fd'),
	('934a885b-0088-44b9-b1eb-611c8079ae44', 'NULL', b'0', 'BUYANDSELL', '강아지 사료 3종 세트를 판매합니다. 건식 5kg, 습식 12캔, 특수식 3kg 모두 2023년 제조된 제품으로 상태 매우 양호합니다. 세 가지 모두 함께 판매하며, 가격은 40,000원입니다. 관심 있는 분은 연락 주세요.', '2024-12-03 16:30:00.000000', 14, '["http://localhost:8080/upload/7b296ba8-a8fe-444d-83af-d3b44881016f.jpg"]', '강아지 사료 3종 세트 판매합니다 (건식, 습식 포함)', '2024-12-03 16:30:00.000000', 298, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('94191526-525e-4f59-afa9-1c940d7c601e', 'NULL', b'0', 'REPORT', '오늘 오후 인천 남동구의 한 주차장에서 차량 안에 장시간 방치된 대형견을 발견했습니다. 외부 기온이 높은 상황에서 물과 그늘 없이 방치되어 있어 동물학대의 심각한 정황을 확인했습니다. 즉각적인 구조와 주인 조사가 필요해 보입니다.', '2024-12-03 16:00:00.000000', 13, '["http://localhost:8080/upload/c588b702-aa56-4f1c-a961-4eff3fcd0f4d.jpg"]', '동물 방치 정황 신고 - 차량 안 유기견 발견', '2024-12-03 16:00:00.000000', 124, '8fb98fb6-6b3c-4a00-92f8-68a0f53bf0ae'),
	('95007f19-3e4b-4bf1-9dfa-12151aff3311', 'NULL', b'0', 'REPORT', '부산 해운대 지역의 한 아파트 단지에서 지속적인 길고양이 학대 정황을 발견했습니다. 최근 3주간 여러 마리의 길고양이가 의심스러운 상황으로 사라졌으며, 명백한 인위적 학대 흔적을 확인했습니다. 해당 지역 경찰과 동물보호단체의 신속한 조사를 요청드립니다.', '2024-12-02 13:30:00.000000', 8, '["http://localhost:8080/upload/0ce126af-9cee-4e11-83f1-7fb558545041.jpg"]', '길고양이 집단 학대 정황 신고합니다', '2024-12-02 13:30:00.000000', 278, '67e2314d-528d-46ba-bcb8-fb9401c92793'),
	('959c7d92-8a71-4149-ab4d-7f14812a27ac', 'NULL', b'0', 'REPORT', '우리 동네에 길고양이가 많습니다. 많은 고양이들이 지나치게 밀집되어 있고, 건강 상태도 좋지 않으며, 주변 환경도 비위생적입니다. 이를 신고하고 싶습니다.', '2024-12-04 15:00:00.000000', 55, '["http://localhost:8080/upload/b2dc6c57-afc8-475e-b4ec-4fa87aab0611.jpg"]', '길고양이 밀집지역 발견', '2024-12-04 15:00:00.000000', 170, '7a92ae42-876c-4297-9b5c-95c6e7de2eda'),
	('9ab6d728-b674-4640-bb88-43090383563d', 'NULL', b'0', 'ANNOUNCEMENT', '유기견 보호소에서는 기부 물품을 받습니다. 유기견들의 생활에 필요한 다양한 물품들에 대한 기부를 부탁드립니다. 필요한 품목은 보호소 공지사항을 통해 확인할 수 있습니다.', '2024-12-05 00:00:00.000000', 75, '[]', '유기견 보호소 기부 물품 안내', '2024-12-05 00:00:00.000000', 160, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('9d39ba93-78c2-40fc-94db-ff436bfa56a2', 'NULL', b'0', 'REPORT', '길거리에 버려진 동물이 학대당하는 모습을 목격했습니다. 동물에게 상처를 입히고 있던 사람을 목격했으니, 조속히 처리가 필요합니다.', '2024-12-04 08:30:00.000000', 45, '["http://localhost:8080/upload/430c24a9-ca6f-4090-a0a8-7ec84b667718.jpg"]', '동물 학대 사건 신고', '2024-12-04 08:30:00.000000', 230, '99571590-bf45-4ad0-ac32-de1c7cb1b1ff'),
	('9dc6f215-28e7-4212-9a76-5f1fa6f9ad2d', 'NULL', b'0', 'ADOPTREVIEW', '\'페페\'를 입양하고 나서 매일매일이 행복해요. 처음엔 많이 겁을 먹었지만, 이제는 내 품에서 자고, 옆에서 같이 시간을 보내요. 정말 소중한 가족이 되었어요.', '2024-12-04 05:30:00.000000', 42, '["http://localhost:8080/upload/efc54a1b-cfbc-4bc2-a1fe-19f686d102f5.jpg"]', '입양한 고양이 \'페페\'의 사랑스러운 모습', '2024-12-04 05:30:00.000000', 230, '368de3a0-e332-4cbd-ac9f-eb8f39c7a97e'),
	('9e5ba380-4089-48e7-937b-ac975a7b29dc', 'NULL', b'0', 'ADOPTREVIEW', '2024년 11월 30일에 입양한 아기 고양이가 이제 첫날을 보내고 있습니다. 처음엔 매우 수줍어했지만, 이제 조금씩 우리 집에 적응하고 있어요. 너무 사랑스러워요!', '2024-12-02 17:20:00.000000', 12, '["http://localhost:8080/upload/664e53be-f114-4ffc-b88d-49288530cb9a.jpg"]', '입양한 아기 고양이 첫 날 후기', '2024-12-02 17:20:00.000000', 312, '7da7183d-1726-458a-a620-93590251ca85'),
	('a07632a9-4622-4805-a156-85530b7be6f7', 'NULL', b'0', 'ADOPTREVIEW', '\'밤비\'는 1살 된 고양이로, 입양 후 2주가 지나면서 점점 더 친근해졌습니다. 처음에는 사람을 많이 경계했지만, 지금은 우리 집에서 가장 사랑받는 고양이가 되었어요. 밤비는 아주 차분하고, 조금 서툴지만 매일 나에게 사랑스러운 눈빛을 보내는 것이 너무 귀엽습니다.', '2024-12-04 16:30:00.000000', 57, '["http://localhost:8080/upload/3bb30c12-b1ab-4864-a8b3-118638a23277.jpg"]', '입양 후 고양이 \'밤비\'와 행복한 시간', '2024-12-04 16:30:00.000000', 170, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('a5a826d1-a91e-41aa-b719-a1e67893e393', 'NULL', b'0', 'FINDCHILD', '\'토토\'는 12월 3일 오후 5시경 실종되었습니다. 검은색과 흰색이 섞인 고양이로, 목에 파란색 목걸이를 착용하고 있습니다. 혹시라도 보셨거나 아시는 분은 연락 부탁드립니다.', '2024-12-04 11:30:00.000000', 50, '["http://localhost:8080/upload/05ae883e-06c1-4dfd-bb12-9682d1697eea.jpg"]', '실종된 고양이 \'토토\'를 찾습니다', '2024-12-04 11:30:00.000000', 150, '54a8cbc2-b17e-419a-b22f-8cf7bb795c29'),
	('a742c09a-7cd5-47b2-9c27-b0ad3b53e48a', 'NULL', b'0', 'ANNOUNCEMENT', '입양을 원하시는 분들은 입양 신청서를 제출해 주세요. 신청서는 보호소에 방문하시거나 온라인으로 제출하실 수 있습니다. 신청서 제출 후 상담을 통해 입양 여부가 결정됩니다.', '2024-12-04 18:00:00.000000', 69, '[]', '유기견 입양 신청서 제출 안내', '2024-12-04 18:00:00.000000', 170, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('b2b5adda-7135-4116-91a1-4968f69cfc87', 'NULL', b'0', 'BUYANDSELL', '고양이 사료 세트 판매합니다. 고급 브랜드로 포장된 5kg짜리 사료와 캔 10개가 포함되어 있습니다. 고양이를 키우시는 분들께 적합합니다.', '2024-12-04 03:00:00.000000', 38, '["http://localhost:8080/upload/f688250f-77ca-4ded-aa26-0dd92afac883.jpg"]', '고양이 사료 팝니다! 고급사료 세트', '2024-12-04 03:00:00.000000', 170, '4651812a-ecf6-4422-b6a4-775620724175'),
	('b3cf0c8d-18ea-4375-a7f4-dab1f028e604', 'NULL', b'0', 'ANNOUNCEMENT', '저희 보호소에서 입양한 유기견들의 후기를 모집합니다. 입양하신 분들의 따뜻한 이야기를 공유해 주세요. 후기를 작성해 주신 분들께는 소정의 선물이 제공됩니다.', '2024-12-04 14:00:00.000000', 65, '[]', '유기견 입양 후기 모집', '2024-12-04 14:00:00.000000', 100, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('b4189de4-8e1b-483a-97f1-4d0cdbe7b934', 'NULL', b'0', 'ADOPTREVIEW', '입양한 강아지가 이제 집에서 너무 행복해 보입니다. 처음에는 조금 낯설어했지만, 이제는 식사 시간마다 꼬리를 흔들며 기다리고 있어요. 입양을 망설이지 마세요!', '2024-12-03 19:00:00.000000', 21, '["http://localhost:8080/upload/83b608c9-5396-4d09-a044-94461221e8f7.jpg"]', '입양한 강아지가 가족이 되기까지', '2024-12-03 19:00:00.000000', 340, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('bb9dbe5b-c97b-428b-a440-f8065888c0f9', 'NULL', b'0', 'BUYANDSELL', '강아지 용품 세트를 판매합니다. 하네스, 배변패드, 사료통 등을 포함한 세트로 사용하지 않는 물품들입니다. 상태는 매우 좋습니다.', '2024-12-04 03:30:00.000000', 39, '["http://localhost:8080/upload/54bc5fc6-5241-4ba4-ace6-59378119b34d.jpg"]', '강아지 용품 세트 판매! 하네스, 배변패드, 사료통', '2024-12-04 03:30:00.000000', 230, '9d6fa4b8-7a0a-4abc-bfe4-6a2929a896e0'),
	('bc9a9f02-c665-4a83-9b5f-cbcdbb50b578', 'NULL', b'0', 'ANNOUNCEMENT', '이번 주 자원봉사 활동 일정은 다음과 같습니다. 12월 5일부터 12월 7일까지 봉사 활동이 예정되어 있으니 많은 참여 부탁드립니다. 봉사에 참여해 주신 분들은 식사 제공이 있습니다.', '2024-12-04 17:00:00.000000', 68, '[]', '유기견 보호소 자원봉사 활동 일정', '2024-12-04 17:00:00.000000', 160, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('c283ae36-5c13-4119-9529-cb6b52c99d47', 'NULL', b'0', 'ANNOUNCEMENT', '매달 진행되는 유기견 보호소 후원 캠페인에 참여해 주세요. 정기 후원자가 되어 유기견들에게 지속적인 지원을 부탁드립니다. 후원에 관한 자세한 사항은 홈페이지에서 확인할 수 있습니다.', '2024-12-04 22:00:00.000000', 73, '[]', '유기견 보호소 정기 후원 캠페인 안내', '2024-12-04 22:00:00.000000', 140, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('c4304cc1-3857-45d2-b2bc-1cf4cd1f35ee', 'NULL', b'0', 'REPORT', '서울 강동구에서 불법 주정차된 차량을 목격했습니다. 교차로 근처에 불법으로 주차된 차량이 있어 교통에 방해가 되고 있습니다. 조속히 처리 부탁드립니다.', '2024-12-03 16:45:00.000000', 18, '["http://localhost:8080/upload/057fd493-f94e-45a2-a28f-7b8e4f8219b7.jpg"]', '불법 주정차 차량 신고합니다', '2024-12-03 16:45:00.000000', 128, '85b95a95-fe4f-4465-98c7-d7ed00653668'),
	('c4b9ad22-298e-49ed-80be-1102b7ceee9a', 'NULL', b'0', 'FINDCHILD', '\'코코\'는 지난 12월 1일 아침 10시경 우리 동네에서 사라졌습니다. 황갈색 푸들로, 작은 크기입니다. 목줄을 착용하고 있었으며, 매우 사람을 좋아하는 성격을 가지고 있습니다. 발견하시면 연락주세요.', '2024-12-04 11:00:00.000000', 49, '["http://localhost:8080/upload/8665397c-71e7-4b53-aaa5-794765158f7e.jpg"]\n[]', '실종된 강아지 \'코코\'를 찾습니다', '2024-12-04 11:00:00.000000', 180, '8fcc64bc-6018-4f24-9dce-ae7160bf106b'),
	('d1482336-c927-4ebe-8e10-f821513b9d02', '관련없는 광고글 삭제', b'1', 'BUYANDSELL', '2023년 모델인 삼성 갤럭시 S23 울트라 256GB 모델을 판매합니다. 상태는 아주 좋으며, 화면 보호 필름과 케이스도 함께 드립니다. 가격은 90만원입니다.', '2024-12-03 18:00:00.000000', 16, '[]', '삼성 갤럭시 S23 울트라 판매합니다', '2024-12-03 18:00:00.000000', 200, '506bedb9-fa45-4700-8372-bee147a12ec2'),
	('d2ea71be-262f-4155-a7c9-310e6e22cace', 'NULL', b'0', 'ADOPTREVIEW', '\'레오\'는 3개월 된 강아지로, 입양 후 첫 번째 주를 보냈습니다. 아주 사랑스러운 성격을 가지고 있고, 사람을 매우 좋아하는 아이라 집에서도 잘 적응하고 있습니다. 처음에는 낯을 가리긴 했지만, 점점 친해지고 있어요. 가족들이 모두 \'레오\'에게 푹 빠졌답니다.', '2024-12-04 16:00:00.000000', 56, '["http://localhost:8080/upload/1070a750-2fd2-4087-a3ea-c8ce2f59af80.jpg"]', '입양한 강아지 \'레오\'와의 첫 번째 만남', '2024-12-04 16:00:00.000000', 230, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('d4e54c6f-46ac-463d-9717-931dd1a9702f', 'NULL', b'0', 'REPORT', '지난주, 일부 상점에서 밀매가 의심되는 애완동물 거래를 확인했습니다. 일부 품종의 고양이나 개가 과도한 가격에 거래되고 있었으니, 조사해주시기 바랍니다.', '2024-12-04 09:00:00.000000', 46, '["http://localhost:8080/upload/59575dc2-603a-4bcb-b932-29cb8c364503.jpg"]', '애완동물 밀매 의심 신고', '2024-12-04 09:00:00.000000', 170, '06a99a75-7bed-4943-9b7b-9ef9a1377bf3'),
	('d7e5a914-5db0-4385-b0ba-8e4d7325cd44', 'NULL', b'0', 'ANNOUNCEMENT', '저희 유기견 보호소에서는 자원봉사자를 모집합니다. 봉사에 관심이 있으신 분들은 신청서를 작성하여 주시기 바랍니다. 봉사활동은 주말에 진행되며, 많은 관심과 참여 부탁드립니다.', '2024-12-04 10:00:00.000000', 61, '[]', '유기견 보호소 자원봉사자 모집 안내', '2024-12-04 10:00:00.000000', 180, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('d8dd07a1-bb8d-49d6-9cd7-6fdf7975a434', 'NULL', b'0', 'FINDCHILD', '경기도 고양시에서 작은 검은색 강아지 \'리틀\'이 실종되었습니다. 목걸이를 착용하고 있었으며, 사람을 매우 좋아하는 성격입니다. 보신 분은 꼭 연락 부탁드립니다.', '2024-12-04 02:00:00.000000', 37, '["http://localhost:8080/upload/d087a99e-647c-4c39-8136-b0e21ba5d0a1.jpg"]', '경기도 고양시에서 실종된 강아지 \'리틀\' 찾습니다', '2024-12-04 02:00:00.000000', 170, 'f56bff85-d3e5-4c05-9b73-d9441950467a'),
	('dcd96622-07de-4568-aad5-37472adefca5', 'NULL', b'0', 'FINDCHILD', '인천 부평구에서 작은 하얀색 푸들 강아지 \'루비\'가 실종되었습니다. 빨간색 리본이 달린 목걸이를 하고 있습니다. 혹시 목격하신 분은 연락 부탁드립니다.', '2024-12-03 23:00:00.000000', 31, '["http://localhost:8080/upload/8ba08a9c-a608-41c9-9a74-d86c66c8b206.jpg"]', '인천 부평구에서 실종된 강아지 \'루비\' 찾습니다', '2024-12-03 23:00:00.000000', 180, '4b319be7-a20d-464f-9ad0-6bc5d401d48c'),
	('e4bb1a12-e8cb-4e7a-b2fc-baa3fd25d855', 'NULL', b'0', 'ANNOUNCEMENT', '유기견 입양 프로그램이 시작되었습니다. 새로운 가족을 찾고 있는 유기견들을 소개해 드립니다. 입양을 원하는 분들은 보호소를 방문하여 상담을 받으세요. 입양 절차와 자세한 사항은 홈페이지를 참고해 주세요.', '2024-12-04 11:00:00.000000', 62, '[]', '유기견 입양 프로그램 안내', '2024-12-04 11:00:00.000000', 200, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('e900b934-f8f3-46ef-b85b-65c5811c0824', 'NULL', b'0', 'REPORT', '인터넷에서 불법으로 애완동물을 판매하는 사이트를 발견했습니다. 해당 사이트에서는 동물을 비위생적인 환경에서 판매하고 있으며, 즉시 조사가 필요합니다.', '2024-12-04 14:30:00.000000', 54, '["http://localhost:8080/upload/ee7e4340-a694-477d-b470-2b8fe12338a8.jpg"]', '불법 애완동물 판매 신고', '2024-12-04 14:30:00.000000', 200, '348d99fe-8c08-436a-8597-31c64598a2f0'),
	('eefe52fe-5527-4fac-b513-c3748e139f79', 'NULL', b'0', 'REPORT', '아파트 단지 내에서 동물을 학대하는 사람을 목격했습니다. 강아지가 계속해서 폭력을 당하고 있으며, 빠른 조치가 필요합니다.', '2024-12-04 14:00:00.000000', 53, '["http://localhost:8080/upload/c9898e28-d5d1-409e-8bde-d880918e1f95.jpg"]', '동물학대 신고', '2024-12-04 14:00:00.000000', 180, '4651812a-ecf6-4422-b6a4-775620724175'),
	('efae056d-e218-42e8-8c8f-dbd8eeda8cd1', 'NULL', b'0', 'BUYANDSELL', '강아지 자동 급식기 5L 모델을 판매합니다. 상태 매우 양호하고, 버튼 하나로 간편하게 급식을 설정할 수 있습니다. 자동으로 일정량의 사료를 급여하며, 강아지에게 유용합니다. 가격은 30,000원입니다.', '2024-12-03 21:15:00.000000', 28, '["http://localhost:8080/upload/d683b454-65fd-4539-b5be-4f19d08ee4ea.jpg"]', '강아지 자동 급식기 5L 판매합니다', '2024-12-03 21:15:00.000000', 400, '7a92ae42-876c-4297-9b5c-95c6e7de2eda'),
	('f074d100-f5be-499d-855f-e3c00102845b', 'NULL', b'0', 'FINDCHILD', '서울 강남구에서 갈색의 포메라니안 강아지 \'초코\'가 실종되었습니다. 빨간색 리본이 달린 목걸이를 하고 있으며, 혹시 보신 분은 연락 부탁드립니다.', '2024-12-04 00:00:00.000000', 33, '["http://localhost:8080/upload/a6572bb4-e924-42d2-a70f-887df4227752.jpg"]', '서울 강남구에서 실종된 강아지 \'초코\' 찾습니다', '2024-12-04 00:00:00.000000', 220, 'c6cbaf96-dc11-467e-939a-6cf69b165f7a'),
	('f558b921-771b-4e96-a8ef-fe1e045376eb', 'NULL', b'0', 'REPORT', '지난 주말, 불법적인 개 사육장을 발견했습니다. 많은 개들이 비좁고 불결한 공간에 갇혀 있으며, 건강 상태가 매우 나쁩니다. 즉시 조치가 필요합니다.', '2024-12-04 13:00:00.000000', 51, '["http://localhost:8080/upload/c976e6e8-eb84-4176-8699-21b3c70efdb7.jpg"]', '불법 개 사육장 신고', '2024-12-04 13:00:00.000000', 250, '368de3a0-e332-4cbd-ac9f-eb8f39c7a97e'),
	('f7357f79-0623-4f0b-98ad-6159a49f5e8e', 'NULL', b'0', 'ANNOUNCEMENT', '입양 전 유기견들을 위한 임시 보호자가 필요합니다. 유기견을 사랑으로 돌봐주실 임시 보호자분들을 모집합니다. 자세한 사항은 공지사항을 참고해 주세요.', '2024-12-04 16:00:00.000000', 67, '[]', '유기견 보호소 임시 보호자 모집', '2024-12-04 16:00:00.000000', 140, 'dcb02621-65da-489b-98f7-0cbe85386d92'),
	('fb752171-f8a2-443e-8d77-965e094c2d62', 'NULL', b'0', 'ADOPTREVIEW', '\'미미\'를 입양한 후 매일매일이 행복한 일상이네요. 미미는 매우 활발하고, 새로운 가족들에게 사랑을 많이 줍니다. 정말 소중한 존재가 되었어요.', '2024-12-04 01:30:00.000000', 36, '["http://localhost:8080/upload/6c8ce34b-082e-4a74-8dc8-97a0b16f0a88.jpg"]', '입양한 강아지 \'미미\'의 행복한 일상', '2024-12-04 01:30:00.000000', 200, '15697d14-7a19-46a4-accb-7c494599ea00'),
	('fc88ef1a-21f2-40bf-ac23-15bb3fe16319', 'NULL', b'0', 'FINDCHILD', '인천 부평구에서 2024년 12월 1일, 강아지가 실종되었습니다. 작은 흰색 강아지로, 목걸이에 전화번호가 적혀 있습니다. 혹시 목격한 분은 연락주세요.', '2024-12-03 09:15:00.000000', 5, '["http://localhost:8080/9cb2b2be-103b-4b7d-a689-54d4c638e62f.jpg"]', '인천 부평구에서 실종된 강아지 찾습니다', '2024-12-03 09:15:00.000000', 121, '4b319be7-a20d-464f-9ad0-6bc5d401d48c');
